import React from 'react';
import './Footer.css'

const Footer = () => {
    return (
        <div className="footer-section">
            <div>
                <h1>We care</h1>
            </div>
            <div>
                <h5>Contact Us</h5>
                <span><i class="fab fa-youtube fa-2x text-secondary"></i></span>
                <span><i class="fab fa-facebook fa-2x text-primary"></i></span>
                <span><i class="fas fa-envelope fa-2x text-danger"></i></span>
            </div>
        </div >
    );
};

export default Footer;
